import React from "react";
import { motion } from "framer-motion";

const LandingPage = () => {
  return (
    <main className="landingPage">
      <motion.section
        initial={{ x: 1500 }}
        animate={{ x: 0 }}
        transition={{ duration: 0.5 }}
        className="marginSection"
      >
        <p className="backgroundHtmlElement">&lt;html&gt;</p>
        <p className="backgroundHtmlElement">&lt;body&gt;</p>
        <p className="backgroundHtmlElement">&lt;h1&gt;</p>
        <h1>
          Hi,<br></br>I'm <span className="colorfulLetter">B</span>astian
          Dammann,
          <br></br>
          <span>web developer</span>
        </h1>
        <p className="backgroundHtmlElement">&lt;/h1&gt;</p>
        <p className="backgroundHtmlElement">&lt;p&gt;</p>

        <p className="headingAddition">
          React /Javascript / SASS / HTML / Bootstrap / Node / Express
        </p>
        <p className="backgroundHtmlElement">&lt;/p&gt;</p>
        <p className="backgroundHtmlElement">&lt;button&gt;</p>

        <button className="contactButton">Contact me</button>
        <p className="backgroundHtmlElement">&lt;/button&gt;</p>
        <p className="backgroundHtmlElement">&lt;/html&gt;</p>
      </motion.section>
    </main>
  );
};

export default LandingPage;
